2161.css:
.grid-item {
    overflow:hidden;
    border-radius:12px;
}
.grid-row {
    margin-top: 8px;
}
.grid-row:first-child {
    margin-top: 0;
}
.wrap {
    position: relative;
    font-family: YS Text, Arial, sans-serif;
}
.content {

    display: flex;
    flex-direction: column;
    background: #fff;
    border-radius: 12px;
    overflow: hidden;
    color: #000;
}
.page_is_dark .content {
    background: rgba(255,255,255,0.95);
}
.content_is_dark .content {
    color: #fff;
    background: rgba(255, 255, 255, 0.2);
}


.header {
    flex: none;
    padding: 12px;
    display: flex;
    flex-direction: column;
}
.title {
    font-size: 18px;
    font-weight: normal;
    line-height: normal;
}
.extra {
    display: flex;
    align-items: center;
    font-size: 13px;
    line-height: 16px;
    margin-top: 8px;
}
.logo {
    flex: none;
    width: 24px;
    height: 24px;
    margin-right: 6px;
    border-radius: 50%;
}
.domain {
    flex: 1 1 auto;
    white-space: nowrap;
    word-break: break-all;
    overflow: hidden;
    text-overflow: ellipsis;
}

.yrw-ya-unit-image-footer {
    background: rgba(255,255,255,0.4);
    color: rgba(0, 0, 0, 0.6);
}
.content_is_dark .yrw-ya-unit-image-footer {
    background: rgba(0,0,0, 0.4);
    color: rgba(255, 255, 255, 0.6);
}
.yrw-ya-unit-image-footer svg text {
    fill: currentColor;
}
.yrw-warning-wrapper {
    padding: 0 7px;
}
.yrw-warning-text {
    line-height: 1.1em;
    text-shadow: none;
    min-height: 12px;
}

.ya-adtune-feedback__complain {
    background: rgba(0, 0, 0, 0.08);
    border-radius: 4px;
    border: none;
}
.ya-adtune-feedback__complain:hover {
    cursor: pointer;
    background: rgba(0, 0, 0, 0.12);
}
.ya-adtune-feedback__form {
    border-radius: 12px;
}
.ya-adtune-feedback__slide {
    transition: opacity .2s ease-out;
    opacity: 0;
    margin-left: 0;
}
.ya-adtune-feedback_visible>.ya-adtune-feedback__slide {
    transition-timing-function: ease-in;
    opacity: 1;
}
.content_is_dark .ya-adtune-feedback__form {
    background: #0D0D0D;
}
.content_is_dark .ya-adtune-feedback__complain {
    background: rgba(255, 255, 255, 0.2);
    border-radius: 4px;
    border: none;
    color: #fff;
}
.content_is_dark .ya-adtune-feedback__complain:hover {
    background: rgba(255, 255, 255, 0.3);
}
.content_is_dark .ya-adtune-feedback__title, .content_is_dark .ya-adtune-feedback__abuse-text{
    color: #fff;
}
.content_is_dark .ya-adtune-feedback__abuse-icon path {
    fill: #fff;
}
.colorful-theme.scope-white .content {
    background-color: #F5F5F5;
    mix-blend-mode: multiply;
}

 .ya-unit-callouts {
   font-size: 14px;
   line-height: 16px;
   letter-spacing: 0.0002em;
   font-weight: 400;
   padding-top: 4px;
}
 .ya-unit-callouts-item {
   color: rgba(0,0,0,0.5);
}

.content_is_dark .ya-unit-sitelink, .content_is_dark .ya-unit-callouts-item {
    color: rgba(255,255,255,0.5)
}


.ya-unit-sitelinks {
    font-size: 14px;
   line-height: 18px;
   letter-spacing: 0.0002em;
   font-weight: 400;
   padding-top: 4px;
}

.ya-unit-sitelink {
    display: inline-block;
    color: rgba(0,0,0,0.5);
}
.ya-unit-sitelink:hover {
    text-decoration: underline;
}

.ya-unit-sitelink:after {
    display: inline-block;
    content: "•";
    margin: 0 5px;
}

.ya-unit-sitelink:last-child:after {
    display: none;
}
.price {
    font-size: 16px;
    line-height: 18px;
    color: #222426;
    margin-right: 8px;
    padding: 4px 0 0;
    margin-bottom: 0px;
    font-weight: 500;
    color: #222426;
}

.ya-unit-price {
    display: inline-block; 
    margin: 0 5px 0 0;
}

.ya-unit-discount {
    display: inline-block;
}
.content_is_dark .ya-unit-price-old {
    color: #ccc
}

.content_is_dark .price {
    color: #fff;
}
